import React from 'react';
import styles from "../styles/Footer.module.css"

const Footer = () => {
    return(
        <footer>
            <div className={styles.footer__container}>
                <div className={styles.links_block}>

                </div>
            </div>
        </footer>
    )
}

export default Footer
